import jsPdf from 'jspdf'
import React, { useContext, Fragment } from 'react';
import { observer } from 'mobx-react-lite';

import { RootStoreContext } from '../../../app/stores/rootStore';
import { Button } from 'semantic-ui-react';
import { IAffilie } from '../../../app/models/affilie';



  const PdfQp:  React.FC<{affilie: IAffilie}> = ({affilie}) => {
  const rootStore = useContext(RootStoreContext);


  const jspdfGenerateur =()=>
  {
      var doc=new jsPdf('p','pt')
      doc.text(affilie.nom,20,20)
      doc.setFont('courier')
      doc.save('generate Pdf')

  }

  return (


    <Fragment>

        <Button onClick={jspdfGenerateur}>generer pdf</Button>


    </Fragment>
  );
};

export default observer(PdfQp);
